import React from 'react'

export default function Netflix() {
  return (
    <div className='cards'>
      <div className='card'>
      <img src="" alt="card_img" />
      <div className='card_info'>
        <span className='card_category'>A NetFlix Original Series</span>
      </div>
      </div>
    </div>
  )
}
